import React, { useState } from 'react';

const redNumbers = [
  1, 3, 5, 7, 9, 12, 14, 16, 18, 19, 21, 23, 25, 27, 30, 32, 34, 36,
];

const Ruleta: React.FC = () => {
  const [selectedBet, setSelectedBet] = useState<'red' | 'black' | 'even' | 'odd' | 'number'>('red');
  const [betNumber, setBetNumber] = useState<number | ''>('');
  const [result, setResult] = useState<number | null>(null);
  const [message, setMessage] = useState('');

  const spinRoulette = () => {
    const roll = Math.floor(Math.random() * 37); // 0-36
    setResult(roll);

    const isRed = redNumbers.includes(roll);
    const isBlack = roll !== 0 && !isRed;
    const isEven = roll !== 0 && roll % 2 === 0;
    const isOdd = roll % 2 === 1;

    let won = false;
    let payout = 0;

    switch (selectedBet) {
      case 'red':
        won = isRed;
        payout = 2;
        break;
      case 'black':
        won = isBlack;
        payout = 2;
        break;
      case 'even':
        won = isEven;
        payout = 2;
        break;
      case 'odd':
        won = isOdd;
        payout = 2;
        break;
      case 'number':
        won = Number(betNumber) === roll;
        payout = 36;
        break;
    }

    if (won) {
      setMessage(`Ai c√¢»ôtigat! üéâ C√¢»ôtig x${payout}`);
    } else {
      setMessage('Ai pierdut üò¢');
    }
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        background: 'linear-gradient(to bottom, #ef4444, #b91c1c)',
        color: 'white',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: '2rem',
      }}
    >
      <h1 style={{ fontSize: '2rem', marginBottom: '1rem' }}>üé° RuletƒÉ</h1>

      <div style={{ marginBottom: '1rem' }}>
        <label htmlFor="bet-type-select">Tip pariu:</label>
        <select
          id="bet-type-select"
          value={selectedBet}
          onChange={(e) => setSelectedBet(e.target.value as any)}
          style={selectStyle}
        >
          <option value="red">Ro»ôu üî¥</option>
          <option value="black">Negru ‚ö´</option>
          <option value="even">Par ‚ôªÔ∏è</option>
          <option value="odd">Impar ‚òùÔ∏è</option>
          <option value="number">NumƒÉr exact üî¢</option>
        </select>
      </div>

      {selectedBet === 'number' && (
        <div style={{ marginBottom: '1rem' }}>
          <label>NumƒÉr (0 - 36):</label>
          <input
            type="number"
            min={0}
            max={36}
            value={betNumber}
            onChange={(e) => setBetNumber(Number(e.target.value))}
            style={inputStyle}
            placeholder="Introdu un numƒÉr"
            title="Introdu un numƒÉr √Æntre 0 »ôi 36"
          />
        </div>
      )}

      <button onClick={spinRoulette} style={buttonStyle}>
        RuleazƒÉ roata! üé∞
      </button>

      {result !== null && (
        <div style={{ marginTop: '1.5rem', fontSize: '20px' }}>
          Rezultat: <strong>{result}</strong>{' '}
          {result === 0 ? 'üü¢' : redNumbers.includes(result) ? 'üî¥' : '‚ö´'}
        </div>
      )}

      {message && (
        <div style={{ marginTop: '1rem', fontSize: '18px', fontWeight: '600' }}>
          {message}
        </div>
      )}
    </div>
  );
};

const buttonStyle: React.CSSProperties = {
  padding: '10px 20px',
  backgroundColor: '#10b981',
  border: 'none',
  borderRadius: '8px',
  color: 'white',
  fontSize: '16px',
  cursor: 'pointer',
};

const selectStyle: React.CSSProperties = {
  marginLeft: '10px',
  padding: '5px',
  borderRadius: '5px',
  fontSize: '16px',
};

const inputStyle: React.CSSProperties = {
  marginLeft: '10px',
  padding: '5px',
  width: '80px',
  borderRadius: '5px',
  fontSize: '16px',
};

export default Ruleta;
